import axios from "axios";
const url='http://localhost:3000/api/users'
class UserService{
    //get posts
    static getPosts() {
        return new Promise ((resolve,reject) => {
            axios.get(url).then((res) => {
                const data=res.data;
                resolve(data.body)
            })
            .catch((err)=> {
                reject(err);
            })
            
        });
    }
    static register(email,password){
        return axios.post(url+'/registration',{email,password}).then(()=>{
            console.log(email);
            console.log(password);
        }).catch(() => {
            console.log('sheet')
        })
    }
    static login(email,password){
            return this.axios.post(url+"/login",
                {email,password}
            ).then(()=>{
                console.log(email);
                console.log(password);
            }).catch(() => {
                console.log("sheet")
            })
    }
}

